import * as React from 'react';
import { TextInput, View, StyleSheet, TouchableOpacity } from 'react-native';
import  Ionicons  from 'react-native-vector-icons/Ionicons';


function SearchScreen(props) {
    const [value, setValue] = React.useState('');
    _search = (text) => {
        setValue(text);
    }
    return (
        <View {...props} style={{backgroundColor: 'white', alignItems:'center',flexDirection:'row', padding:5, borderRadius:40, width: 250}}>
            <Ionicons name='md-search' size={30} style={{marginLeft:10}}/>
            <TextInput 
                placeholder='Search'
                onChangeText={text => _search(text)}
                returnKeyType= 'search'
                value={value}
                onSubmitEditing={()=> props.navigation.navigate('result')}
            />
        </View>
    );
}
export {SearchScreen};
